import { Navbar } from "../Layout/Navbar";
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { getAllMaps } from "./HomeBehavior";
import "./style.css";
export const HomePage = () => {
  let nav = useNavigate();
  const [GetAllmap, setGetAllMap] = useState([]);

  const getAllMap = async () => {
    try {
      const getMap = await getAllMaps();

      if (getMap.success) {
        setGetAllMap(getMap.Map_of_User.Maps);
      }
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    // if (!localStorage.getItem("token")) {
    //   return nav("/login");
    // }
    getAllMap();
    console.log("Map", GetAllmap);
  });
  return (
    <>
      <Navbar></Navbar>
      <div style={{ display: "flex" }}>
        <div className="cssforUl">
          {/* {GetAllmap &&
            GetAllmap.map((item, index) => (
              <div class="cssforUl-li">{GetAllmap[index].name}</div>
            ))} */}
            <div class="cssforUl-li card">
                    <img class="card-img-top" src="https://www.gettyimages.in/gi-resources/images/Homepage/Hero/UK/CMS_Creative_164657191_Kingfisher.jpg" alt=""/>
                    <div class="card-body">
                        <h5 class="card-title">Tiêu đề Card</h5>
                        <h6 class="card-subtitle mb-1 text-muted">Ví dụ mẫu sử dụng Card</h6>
                        <p class="card-text">Nội dung văn bản trong <code>.card-body</code> này sử dụng <code>.card-text</code>.</p>
                        <a href="#" class="btn btn-primary">Nút bấm</a>
                    </div>
                    <div class="card-footer text-muted">
                        Footer của Card
                    </div>
                </div>
        </div>
      </div>
    </>
  );
};
